import React from 'react';
import './button.css';

function Button(props) {
  const { name } = props;

  return (
    <>
      <button type="button" className="high">Hi! {name[0]}</button>
      <button type="button" className="medium">Hi! {name[1]}</button>
      <button type="button" className="low">Hi! {name[2]}</button>
    </>
  );
}

export default Button;
